import React from 'react';
import logo from './images/logo.png';
import "./Header.css";


function Header() {
  return ( 
    
<div className = "Main"> 

<div className = "MainLogo" >
 <img src = {logo} alt = "logo"> 
 
 </img>

 <div className = "Mid">

<h2> Nosdeive into the bleeding edge of Technology! </h2> 

 </div>
 
 </div>

</div>

  )

}

export default Header;
